lass\":0:{}}s:33:\"visualizer-pro/visualizer-pro.php\";O:8:\"stdClass\":11:{s:11:\"new_version\";s:5:\"1.8.0\";s:14:\"stable_version\";s:5:\"1.8.0\";s:4:\"name\";s:37:\"Visualizer: Tables and Charts Manager\";s:4:\"slug\";s:14:\"visualizer-pro\";s:7:\"package\";s:486:\"https://themeisle.com/plugins/visualizer-charts-and-graphs/?edd_action=package_download&\";s:13:\"download_link\";s:486:\"https://themeisle.com/plugins/visualizer-charts-and-graphs/?edd_action=package_download&\";s:3:\"url\";s:138:\"https://themeisle.com/plugins/visualizer-charts-and-graphs/?edd_action=view_changelog&name=Visualizer%3A%20Tables%20and%20Charts%20Manager\";s:12:\"last_updated\";s:19:\"2019-01-11 12:57:21\";s:8:\"homepage\";s:59:\"https://themeisle.com/plugins/visualizer-charts-and-graphs/\";s:8:\"sections\";a:1:{s:9:\"changelog\";s:3886:\"\r\n<h3>v1.8.0 - 03/12/2018</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li>Add Table chart to free and deprecate Google Table chart</li>\r\n 	<li>Create charts using SQL queries</li>\r\n</ul>\r\n<h3>v1.7.8 - 11/10/2018</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li>Added filter to enable users to change schedule of charts.</li>\r\n</ul>\r\n\r\n<h3>v1.7.7 - 12/07/2018</h3>\r\n<h4>Changes:</h4>\r\n<ul>n\r\n 	<li>New chart title option for the back-end of the charts that don\\\'t allow a title on the front-end</li>\r\n 	<li>Added options for charts animations</li>\r\n 	<li>Fixed problem with Table charts throwing a fatal error</li>\r\n</ul>\r\nn\r\n<h3>v1.7.6 - 18/06/2018</h3>\r\n<h4>Changes:</h4>\r\n<ul>n\r\n 	<li>Fixed problem with adding a new row in the Manual Data mode</li>\r\n 	<li>Support series formatting for Table chart type</li>\r\n</ul>\r\nn\r\n\r\n\r\n<h3>v1.7.5 - 02/04/2018</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li> Fix small issues non</li>\r\n 	<li>English sites.</li>\r\n</ul>\r\n<h3>v1.7.4 - 12/03/2018</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li> Fix collision check with TGMP library.\r\n Improve Import from WP default state.</li>\r\n</ul>\r\n<h3>v1.7.3 - 05/01/2018</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li> Fix enqueue for frontend assets when no chart is present.</li>\r\n</ul>\r\n<h3>v1.7.2 - 06/10/2017</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li> Improves compatibility with various themes.\r\n Added custom post types filter for import.</li>\r\n</ul>\r\n<h3>v1.7.1 - 08/09/2017</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li> Fix for fatal error with admin when using the old LITE version.</li>\r\n</ul>\r\n<h3>v1.7.0 - 05/09/2017</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li> Adds more customization options for table charts.\r\n Adds permission feature for charts\r\n Allow private charts and front submissions.</li>\r\n</ul>\r\n<h3>v1.6.3 - 19/06/2017</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li> Added new sdk logic.</li>\r\n</ul>\r\n<h3>v1.6.1 - 30/05/2017</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li>Updated themeisle sdk package.</li>\r\n</ul>\r\n<h3>v1.6.0 - 12/05/2017</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li>Added import from post_type feature.</li>\r\n 	<li>Added new deployment stack.</li>\r\n</ul>\r\n<h3>v1.5.1 - 13/04/2017</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li>Added schedule import.</li>\r\n 	<li>Improved UI of the builder.</li>\r\n 	<li>Added support for new features in the business plans.</li>\r\n</ul>\r\n<h3>v1.2.0 - 13/04/2017</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li>Added schedule import.</li>\r\n 	<li>Improved UI of the builder.</li>\r\n 	<li>Added support for new features in the business plans.</li>\r\n</ul>\r\n<h3>v1.1.0 - 26/08/2016</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li>Disable column sorting for tables</li>\r\n 	<li>Fixed possible security bug</li>\r\n</ul>\r\n<h3>v1.0.5 - 05/07/2016</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li>Added TGM for the free version</li>\r\n 	<li>Enabled 3 more chart types ( Combo, Timeline and Table chart )</li>\r\n 	<li>Fixed bug on saving empty values</li>\r\n</ul>\r\n<h3>v1.0.4 - 26/05/2016</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li style=\\\"list-style-type: none;\\\">\r\n<ul>\r\n 	<li>Fixed issue with zero value in spreadsheet table</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<h3>1.0.3 - 04/03/2016</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li style=\\\"list-style-type: none;\\\">\r\n<ul>\r\n 	<li style=\\\"list-style-type: none;\\\">\r\n<ul>\r\n 	<li>Saving data when showing chartsaving data when showing chart instead of saving at every change</li>\r\n 	<li>Fixed issues with saving for spreadsheet editor</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<h3>1.0.2 - 11/02/2016</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li style=\\\"list-style-type: none;\\\">\r\n<ul>\r\n 	<li style=\\\"list-style-type: none;\\\">\r\n<ul>\r\n 	<li>Fixed import from chart empty titles</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<h3>1.0 - 02/11/2015</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li style=\\\"list-style-type: none;\\\">\r\n<ul>\r\n 	<li>Added unlimited rows</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<h3>v1.2.0 - 14/12/2016</h3>\r\n<h4>Changes:</h4>\r\n<ul>\r\n 	<li>Improved upsell mechanism in free</li>\r\n</ul>\";}s:7:\"banners\";s:41:\"a:2:{s:4:\"high\";s:0:\"\";s:3:\"low\";s:0:\"\";}\";}}s:12:\"translations\";a:0:{}s:9:\"no_update\";a:4:{s:9:\"hello.php\";O:8:\"stdClass\":9:{s:2:\"id\";s:25:\"w.org/plugins/hello-dolly\";s:4:\"slug\";s:11:\"hello-dolly\";s:6:\"plugin\";s:9:\"hello.php\";s:11:\"new_version\";s:3:\"1.6\";s:3:\"url\";s:42:\"https://wordpress.org/plugins/hello-dolly/\";s:7:\"package\";s:58:\"https://downloads.wordpress.org/plugin/hello-dolly.1.6.zip\";s:5:\"icons\";a:2:{s:2:\"2x\";s:63:\"https://ps.w.org/hello-dolly/assets/icon-256x256.jpg?rev=969907\";s:2:\"1x\";s:63:\"https://ps.w.org/hello-dolly/assets/icon-128x128.jpg?rev=969907\";}s:7:\"banners\";a:1:{s:2:\"1x\";s:65:\"https://ps.w.org/hello-dolly/assets/banner-772x250.png?rev=478342\";}s:11:\"banners_rtl\";a:0:{}}s:20:\"visualizer/index.php\";O:8:\"stdClass\":9:{s:2:\"id\";s:24:\"w.org/plugins/visualizer\";s:4:\"slug\";s:10:\"visualizer\";s:6:\"plugin\";s:20:\"visualizer/i