(516, '7238c9070c32ed98a38810e053129a9a', 'a:2:{s:7:\"timeout\";i:1550173662;s:5:\"value\";a:14:{s:11:\"new_version\";s:5:\"2.4.4\";s:14:\"stable_version\";s:5:\"2.4.4\";s:4:\"name\";s:13:\"Elementor Pro\";s:4:\"slug\";s:13:\"elementor-pro\";s:3:\"url\";s:36:\"https://elementor.com/pro/changelog/\";s:12:\"last_updated\";s:19:\"2019-02-11 15:28:32\";s:8:\"homepage\";s:26:\"https://elementor.com/pro/\";s:8:\"requires\";s:3:\"4.7\";s:6:\"tested\";s:3:\"5.0\";s:7:\"package\";s:0:\"\";s:13:\"download_link\";s:0:\"\";s:8:\"sections\";s:61501:\"a:2:{s:11:\"description\";s:161:\"Elementor Pro adds new features to the Elementor Page Builder plugin. Control your conversions, your user engagement, your entire website, from one page builder.\";s:9:\"changelog\";s:61279:\"<h4>2.4.4 - 2019-02-11</h4>\n<ul>\n<li>Tweak: Added ACF Date Time Picker field support (<a href=\"https://github.com/pojome/elementor/issues/6690\">#6690</a>)</li>\n<li>Tweak: Changed the term of <code>All Posts</code> condition to <code>Posts</code></li>\n<li>Fix: Added <code>&lt;IfModule&gt;</code> to avoid 500 error when <code>mod-headers</code> is missing (<a href=\"https://github.com/pojome/elementor/issues/7034\">#7034</a>)</li>\n<li>Fix: Include post CSS deletion in Global Widget update (<a href=\"https://github.com/pojome/elementor/issues/6856\">#6856</a>)</li>\n<li>Fix: <code>Textarea</code> default value in Forms Widget (<a href=\"https://github.com/pojome/elementor/issues/6934\">#6934</a>)</li>\n<li>Fix: MailPoet latest version caused fatal error (<a href=\"https://github.com/pojome/elementor/issues/6996\">#6996</a>)</li>\n<li>Fix: Fatal Error caused by calling MailPoet deleted method</li>\n<li>Notice: MailPoet <code>Auto Confirm</code> option will now default to &quot;On&quot;</li>\n</ul>\n<h4>2.4.3 - 2019-01-30</h4>\n<ul>\n<li>Fix: Custom Add to Cart widget responsive alignment settings</li>\n<li>Fix: Links in Post Info widget</li>\n<li>Fix: WooCommerce <code>View Cart</code> string translate</li>\n<li>Fix: Wrapper classes for header/footer templates (<a href=\"https://github.com/pojome/elementor/issues/6884\">#6884</a>)</li>\n</ul>\n<h4>2.4.2 - 2019-01-25</h4>\n<ul>\n<li>Tweak: Added pixel units to Close Button position control in Popups</li>\n<li>Fix: Exclude error in WC Products widget</li>\n</ul>\n<h4>2.4.1 - 2019-01-24</h4>\n<ul>\n<li>Tweak: Added CSS classes control to Popup (<a href=\"https://github.com/pojome/elementor/issues/6826\">#6826</a>)</li>\n<li>Tweak: Added responsive image size to Testimonial Carousel widget</li>\n<li>Fix: PHP warning when Toolset Date dynamic is empty (<a href=\"https://github.com/pojome/elementor/issues/6842\">#6842</a>)</li>\n<li>Fix: Support of exclude-ids in WC Products widget</li>\n<li>Fix: Popup close button not clickable</li>\n<li>Fix: Alignment justify issue of Add to Cart widget (<a href=\"https://github.com/pojome/elementor/issues/6749\">#6749</a>)</li>\n<li>Fix: Bad anchors breaks the page JS</li>\n<li>Fix: Popup overlay shown when turned off</li>\n</ul>\n<h4>2.4.0 - 2019-01-21</h4>\n<ul>\n<li>New: Introducing Popup Builder (<a href=\"https://github.com/pojome/elementor/issues/628\">#628</a>)</li>\n<li>New: Added <code>Popup</code> Dynamic Tag</li>\n<li>New: Added <code>Popup</code> forms action after submit</li>\n<li>New: Added User Info dynamic tag (<a href=\"https://github.com/pojome/elementor/issues/6322\">#6322</a>)</li>\n<li>Tweak: Added dynamic capabilities for &quot;Nothing Found&quot; message</li>\n<li>Tweak: Added <code>elementor_pro/theme_builder/archive/escape_nothing_found_message</code> Filter to avoid HTML escaping in &quot;Nothing Found&quot; message (<a href=\"https://github.com/pojome/elementor/issues/6053\">#6053</a>)</li>\n<li>Tweak: Added <code>add_doc_to_location</code> method to Allow insertion of a document to a location</li>\n<li>Fix: <code>z-index</code> issue with CTA widget (<a href=\"https://github.com/pojome/elementor/issues/6486\">#6486</a>)</li>\n<li>Fix: Hide the Post Content widget and show it only in a Single document</li>\n<li>Fix: <code>selector</code> replacement in Custom CSS</li>\n<li>Fix: Apply <code>the_content</code> on the real content only</li>\n<li>Fix: CSS for WC products selector (<a href=\"https://github.com/pojome/elementor/issues/6559\">#6559</a>)</li>\n<li>Fix: Odnoklassniki share URL (<a href=\"https://github.com/pojome/elementor/issues/6638\">#6638</a>)</li>\n<li>Fix: Custom link new tab in Post Info widget (<a href=\"https://github.com/pojome/elementor/issues/5766\">#5766</a>)</li>\n<li>Fix: <code>nofollow</code> link in Flip Box &amp; CTA widgets</li>\n<li>Fix: Post Terms in Post Info widget</li>\n<li>Fix: Added screen reader to some icons &amp; buttons for better accessibility (<a href=\"https://github.com/pojome/elementor/issues/5386\">#5386</a>)</li>\n<li>Fix: Accessibility labels in Reviews widget (<a href=\"https://github.com/pojome/elementor/issues/6630\">#6630</a>)</li>\n<li>Fix: Link to cart page not working when WooCommerce Subscriptions is active</li>\n<li>Fix: MailChimp Selected list not showing on reloading in Form widget</li>\n<li>Fix: Sub-menu arrow position in Nav Menu widget</li>\n<li>Fix: Conflict with WP Security Audit Log plugin (<a href=\"https://github.com/pojome/elementor/issues/6648\">#6648</a>)</li>\n</ul>\n<h4>2.3.1 - 2018-12-19</h4>\n<ul>\n<li>Fix: Template widget search functionality (<a href=\"https://github.com/pojome/elementor/issues/6473\">#6473</a>)</li>\n<li>Fix: Apply <code>the_content</code> filter to post content in theme builder</li>\n</ul>\n<h4>2.3.0 - 2018-12-17</h4>\n<ul>\n<li>New: Introducing Discord Integration for Forms (<a href=\"https://github.com/pojome/elementor/issues/4218\">#4218</a>)</li>\n<li>New: Introducing Slack Integration for Forms</li>\n<li>New: Introducing MailerLite Integration for Forms (<a href=\"https://github.com/pojome/elementor/issues/4462\">#4462</a>)</li>\n<li>New: Activate Elementor Pro plugin by connecting to Elementor account</li>\n<li>Tweak: Added <code>elementor_pro/utils/get_public_post_types</code> filter hook (<a href=\"https://github.com/pojome/elementor/issues/5900\">#5900</a>)</li>\n<li>Tweak: Added <code>loop_start</code> &amp; <code>the_content</code> hooks for Post Content (<a href=\"https://github.com/pojome/elementor/issues/6173\">#6173</a>)</li>\n<li>Tweak: Removed Custom Attributes from Page Settings</li>\n<li>Tweak: Always add the Custom CSS control to the Advanced tab</li>\n<li>Fix: In sub Term condition false positive in edge cases</li>\n<li>Fix: ToolSet Dynamic Image fallback</li>\n<li>Fix: Style glitch with the dropdown color in Nav Menu widget</li>\n<li>Fix: Style glitch in the Conditions screen in Safari browser</li>\n<li>Fix: Ribbon in the CTA widget obscures drop down menu (<a href=\"https://github.com/pojome/elementor/issues/6080\">#6080</a>)</li>\n<li>Fix: The color of label won\'t change color in Widget login</li>\n</ul>\n<h4>2.2.5 - 2018-12-11</h4>\n<ul>\n<li>New: Add Style Tab &amp; Custom CSS for Header &amp; Footer Templates.</li>\n<li>Tweak: Added a better identifier for subpages (<a href=\"https://github.com/pojome/elementor/issues/6362\">#6362</a>)</li>\n<li>Tweak: Removed Custom Attributes from page settings</li>\n<li>Fix: Yahoo event URL date issue (<a href=\"https://github.com/pojome/elementor/issues/6354\">#6354</a>)</li>\n<li>Fix: Allow timezone settings in Google event URL (<a href=\"https://github.com/pojome/elementor/issues/6354\">#6354</a>)</li>\n<li>Fix: Avoid <code>z-index</code> changes by <code>nanocss</code> in build process</li>\n<li>Fix: Added missing WC upsells products CSS</li>\n<li>Fix: Nav Menu dropdown losing color on hover</li>\n<li>Fix: WC Product Add-ons CSS compatibility</li>\n</ul>\n<h4>2.2.4 - 2018-12-04</h4>\n<ul>\n<li>Fix: Global widget not saving changes (<a href=\"https://github.com/pojome/elementor/issues/6340\">#6340</a>)</li>\n<li>Fix: Dynamic tags support in Blockquote widget (<a href=\"https://github.com/pojome/elementor/issues/6334\">#6334</