ict with Ad Blockers and Share Buttons</li>\n<li>Fix: Current date time dynamic tag now shows local time</li>\n<li>Fix: Avoid conflict with 3rd party plugins that filter the permalink</li>\n<li>Fix: Avoid PHP warning when no groups are selected for MailChimp integration</li>\n<li>Fix: Avoid PHP warning if checkbox field is empty for ACF</li>\n<li>Fix: Respect password protected for a WC single product template</li>\n<li>Fix: Respect <code>order</code> settings for WC archive also without pagination</li>\n</ul>\n<h4>2.1.10 - 2018-10-09</h4>\n<ul>\n<li>Tweak: Added responsive alignment control for Share Buttons widget (<a href=\"https://github.com/pojome/elementor/issues/5821\">#5821</a>)</li>\n<li>Tweak: Added link control to Animated Headline widget</li>\n<li>Fix: Mobile nav menu jump on RTL (<a href=\"https://github.com/pojome/elementor/issues/5711\">#5711</a>)</li>\n<li>Fix: Responsive alignment control in Add to Cart widget (<a href=\"https://github.com/pojome/elementor/issues/5830\">#5830</a>)</li>\n<li>Fix: Added IE compatibility for Animated Headline widget</li>\n<li>Fix: Post Content widget is now shown only on <code>Single</code> templates</li>\n<li>Fix: Query Control Pagination with offset</li>\n</ul>\n<h4>2.1.9 - 2018-09-17</h4>\n<ul>\n<li>Tweak: Added Centered Slides option for Slideshow carousel</li>\n<li>Fix: Allow only public CPT for Manual Selection in Query Control (<a href=\"https://github.com/pojome/elementor/issues/5091\">#5091</a>)</li>\n<li>Fix: ACF Gallery option support (<a href=\"https://github.com/pojome/elementor/issues/5344\">#5344</a>)</li>\n<li>Fix: Page scrolling on resize when sticky is active (<a href=\"https://github.com/pojome/elementor/issues/5740\">#5740</a>)</li>\n<li>Fix: Edit custom name for Global Widget in the Navigator (<a href=\"https://github.com/pojome/elementor/issues/5689\">#5689</a>)</li>\n<li>Fix: Coverflow transition effect in Carousel</li>\n<li>Fix: Weird mobile behavior with Cube effect in Carousel</li>\n<li>Fix: S