o</a>) (<a href=\"https://github.com/pojome/elementor/issues/1748\">#1748</a>)</li>\n<li>Tweak: Added form-message style (<a href=\"https://github.com/pojome/elementor/issues/1180\">#1180</a>)</li>\n<li>Tweak: Added dynamic tag for button on the Price Table widget (<a href=\"https://github.com/pojome/elementor/issues/4242\">#4242</a>)</li>\n<li>Tweak: Added dynamic tag for Call to action widget (<a href=\"https://github.com/pojome/elementor/issues/4767\">#4767</a>)</li>\n<li>Tweak: Added Dynamic Tags support for Google Map field (<a href=\"https://github.com/pojome/elementor/issues/4602\">#4602</a>)</li>\n<li>Tweak: Added an support for <code>label|value</code> in options field (<a href=\"https://github.com/pojome/elementor/issues/4594\">#4594</a>)</li>\n<li>Tweak: Added <code>by-author</code> condition for theme builder (<a href=\"https://github.com/pojome/elementor/issues/4681\">#4681</a>)</li>\n<li>Tweak: Added Activate/Deactivate license key via WP-CLI command (<a href=\"https://github.com/pojome/elementor/issues/4149\">#4149</a>)</li>\n<li>Tweak: Added <code>is_scroll</code> trigger to scrolling effect (<a href=\"https://github.com/pojome/elementor/issues/4340\">#4340</a>)</li>\n<li>Tweak: Added In Same Term support for Post Navigation widget (<a href=\"https://github.com/pojome/elementor/issues/4177\">#4177</a>)</li>\n<li>Tweak: Added responsive control for Slides To Scroll control in all carousel widgets (<a href=\"https://github.com/pojome/elementor/issues/3697\">#3697</a>)</li>\n<li>Tweak: Added style options for Posts widget (<a href=\"https://github.com/pojome/elementor/issues/1335\">#1335</a>)</li>\n<li>Tweak: Added button CSS ID for Forms widget</li>\n<li>Tweak: Added pixel units to Post-Info divider height control</li>\n<li>Tweak: Rewrite sticky library to handle with stretch section, auto scroller &amp; more bugs</li>\n<li>Tweak: Re-organize the panel categories per document type</li>\n<li>Tweak: Added ACF support for <code>options-page</code> fields<